	<p class="c72"><span class="c66">Ref No: </span><span class="c64">VT/HO/2019-20/<?=date('y')?>/001</span><span class="c66">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Date: </span><span class="c64"><?=date('d-M-Y')?></span></p>
	<p class="c9 c44"><span class="c36"></span></p>
	<p class="c9"><span class="c22">To,</span></p>
	<p class="c9"><span class="c17">M/s. </span><span class="c12"><?=$enq_name?></span></p>
	<p class="c9"><span class="c17">Address</span><span class="c12"><?=$address?></span></p>
	<p class="c9"><span class="c12"></span></p>
	<p class="c9"><span class="c12"></span></p>
	<p class="c9 c44"><span class="c22 c30"></span></p>
	<p class="c9"><span class="c17">Mobile No. </span><span class="c12"><?=$mobile?></span></p>
	<p class="c9"><span class="c17">Email ID. </span><span class="c12"><?=$email?>.</span></p>
	<p class="c55 c44"><span class="c12"></span></p>
	<p class="c21"><span class="c22 c25">Kind Attention</span><span class="c22">:&nbsp;</span><span class="c52">Mr. /Ms.</span><span class="c22"> <?=$enq_name?></span><span class="c36">. </span></p>
	<p class="c55"><span class="c23">Dear Sir/Madam,</span></p>
	<p class="c9"><span class="c25 c51">Subject:&nbsp; </span><span class="c8">Quotation for Transportation of your valued materials.</span></p>
	<p class="c9 c44"><span class="c36"></span></p>
	<p class="c55"><span class="c23">This is in continuation to our discussion regarding your logistic needs; firstly we would like to express our gratitude for the confidence shown in our services by inviting our business proposal.</span></p>
	<p class="c55"><span class="c23">Pleased find enclosed a write up of our company&rsquo;s profile for your information. (Annexure &ndash; 1)</span></p>
	<p class="c55"><span class="c64">Further on the subjected, we are enclosing our rate annexure for the transportation of your goods along with terms and </span><span class="c23">conditions. (Annexure &ndash;2) </span></p>
	<p class="c55"><span class="c23">We are very confident that we will be able to fulfil all your requirements and will bring more value on the table with value added services such as dedicated customer service team, speedy response, 24 X 7 tracking on desktop as well as mobile, transit insurance and many more delightful features and privileges.&nbsp; </span></p>
	<p class="c55"><span class="c23">Should you require any clarifications or further information, please feel free to contact us at the below given address. </span></p>
	<p class="c55"><span class="c23">Thanking you and we look forward to the pleasure of your patronage.</span></p>
	<p class="c21 c44"><span class="c36"></span></p>
	<p class="c21"><span class="c75 c66">For V-Trans (India) Ltd.</span></p>
	<p class="c21 c44"><span class="c36"></span></p>
	<p class="c9"><span class="c22">Name: </span><span class="c52"><?=$user?></span></p>
	<p class="c5"><span class="c17">Designation: </span><span class="c52"><?=$user_deg?></span></p>
	<p class="c5"><span class="c17">Mobile No.:</span><span class="c52"> <?=$user_mobile?></span></p>
	<p class="c5"><span class="c17">Email ID:</span><span class="c52"> <?=$user_email?></span></p>
	<p class="c5"><span class="c36">&nbsp;</span></p>
	<p class="c21"><span class="c66">Encl:</span><span class="c64">&nbsp;As Stated above.</span><span class="c65">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p>
